import React, { useState } from 'react';

function ModelSelection() {
  const [selectedModel, setSelectedModel] = useState('');

  const handleModelChange = (event) => {
    setSelectedModel(event.target.value);
  };

  return (
    <div>
      <label htmlFor="model-dropdown">Select Model:</label>
      <select id="model-dropdown" value={selectedModel} onChange={handleModelChange}>
        <option value="">-- Select a Model --</option>
        <option value="GPT-4">GPT-4</option>
        <option value="GPT-3.5">GPT-3.5</option>
      </select>
      <button disabled={!selectedModel}>
        {selectedModel ? `Selected Model: ${selectedModel}` : 'Select a Model'}
      </button>
    </div>
  );
}

export default ModelSelection;
